import styled from "styled-components";
import MainPicDummy from "../../../dummyResources/MainPicDummy.jpg";
import HeaderPic from "./HeaderPic";
import HeaderTextDescription from "./HeaderTextDescription";
import HeaderTextHeading from "./HeaderTextHeading";

interface Props {
  children: React.ReactNode;
}

const SHeader = styled.div`
  width: 100%;
  position: relative;
`;

const HeaderText = styled.div`
  color: white;
  position: absolute;
  bottom: 8%;
  left: 3%;
  width: 65%;
`;

export default function Header(props: Props) {
  return (
    <SHeader>
      <HeaderPic src={MainPicDummy} />
      <HeaderText>
        {props.children}
      </HeaderText>
    </SHeader>
  );
}
